import Card from "./ComShoop/Card";
import { Cabeza } from "./componente/Cabeza";
import Menu from "./componente/Menu";

function Shop() {
  return (
        <div>
            <Cabeza></Cabeza>
            <Menu></Menu>
            <Card></Card>
        </div>
    );
}



export default Shop;
